import * as api from '../api';


export const logIn = (logInData) => async (dispatch) => {
  try {
    const { data } = await api.logIn(logInData);
    console.log("from action ")
    console.log(data)
    dispatch({
      type: "LOG_IN",
      payload: data
    });
  } catch (error) {
    console.log(error)
  }
}
